	     lore: 'Greatness comes in all shapes and sizes, as proven by this diminutive, cannon-wieldingyordle. In a world fraught with turmoil, Tristana refuses to back down from any challenge. She represents the pinnacle of martial proficiency, unwavering courage, and boundless optimism. For Trist and her gun, Boomer, every mission is a chance to prove that heroes do exist.',
	     blurb: 'Greatness comes in all shapes and sizes, as proven by this diminutive, cannon-wieldingyordle. In a world fraught with turmoil, Tristana refuses to back down from any challenge. She represents the pinnacle of martial proficiency, unwavering courage, ...',
